import React from "react";

function Contact() {
  return (
    <>
      <h2>
      Find Us
      </h2>
      <h3>(719)312-1005</h3>
      <h3>106 N Park Street, Manzanola, CO 81058</h3>
      <h3>Monday-Thursday 9AM-10PM</h3>
      <h3>Friday 9AM-12PM</h3>
      <h3>Saturday 9AM-12PM</h3>
      <h3>Sunday 9AM-10PM</h3>
    </>
  );
}

export default Contact;
